import React, { useEffect, useState } from 'react'
import "./Iphone11.css"
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { MenuItem, Select } from '@mui/material';


function Iphone11() {

    const [iphone,setIphone] = useState()

       const getIphone = async ()=>{
        const url = "http://localhost:5000/iphone/iphone11"

        const response = await fetch(url);
        const responseJson = await response.json();

        setIphone(responseJson.iphone)
    }

        useEffect(()=>{
          getIphone()
        },[])

  return (

  <div>
   <Box sx={{ minWidth: 275 }}>
      <Card variant="outlined">
      <CardContent>
      <Typography  variant="h5" color="text.secondary" gutterBottom>
       בחר צבע:
      </Typography>
      <Select
    labelId="demo-simple-select-label"
    id="demo-simple-select"
    label="בחר צבע:"
    // onChange={handleChange}
  >
    <MenuItem value={"RED(PRODUCT)"}>RED(PRODUCT)</MenuItem>
    <MenuItem value={"Midnight"}>Midnight</MenuItem>
    <MenuItem value={"Starlight"}>Starlight</MenuItem>
    <MenuItem value={"Purple"}>Purple</MenuItem>
  </Select>



  <Typography  variant="h5" color="text.secondary" gutterBottom>
       בחר צבע:
      </Typography>
      <Select
    labelId="demo-simple-select-label"
    id="demo-simple-select"
    label="בחר צבע:"
    // onChange={handleChange}
  >
    <MenuItem value={"RED(PRODUCT)"}>RED(PRODUCT)</MenuItem>
    <MenuItem value={"Midnight"}>Midnight</MenuItem>
    <MenuItem value={"Starlight"}>Starlight</MenuItem>
    <MenuItem value={"Purple"}>Purple</MenuItem>
  </Select>

    </CardContent>
    </Card>
    </Box>


  </div>
  )
}

export default Iphone11
